import React from 'react';
import PropTypes from 'prop-types';


const Section = (props) => {
  return(
    //<AboutUs />
    <section className="" style={{height:'100vh'}}>
      <props.body backgroundStyle={props.backgroundStyle}/>
    </section>
  );
}

Section.propTypes = {
  handleNav: PropTypes.func.isRequired,
  backgroundStyle: PropTypes.object.isRequired,
  body: PropTypes.node
}


export default Section;
